import { useCallback, useEffect, useState } from "react";
import useCustomDiary from "../../hooks/useCustomDiary";
import useCustomLogin from "../../hooks/useCustomLogin";
import { Link, useParams } from "react-router-dom";
import Image from "react-bootstrap/Image";
import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";
import { getDiary } from "../../api/diaryApi";

const initState = {
  content: "",
  picture: "",
  dateobject: "",
  updatedAt: "",
  id: "",
};

const DiaryReadComponent = () => {
  const [diaryParam, setDiaryParam] = useState({ ...initState });

  const { id } = useParams();
  const {
    postDiaryC,
    moveToDiaryRead,
    moveToDiaryCreate,
    deleteDiaryC,
    moveToDiaryList,
  } = useCustomDiary();

  useEffect(() => {
    console.log("DiaryReadComponent.js useEffect() ÏßÑÏûÖ id=> ", id);

    //api
    const getDiaryEI = async () =>
      await getDiary(id)
        .then((result) => {
          // console.log(
          //   "DiaryReadComponent.js useEffect ÎÇ¥ getDiary axios Ìò∏Ï∂úÌõÑ then() => ",
          //   result
          // );
          setDiaryParam({ ...result.data });
        })
        .catch((err) => {
          console.log(
            "DiaryReadComponent.js useEffect ÎÇ¥ getDiary axios Ìò∏Ï∂úÌõÑ catch() => ",
            err
          );
        });

    getDiaryEI();
  }, []);

  const deleteOnClick = () => {
    deleteDiaryC(diaryParam.id)
      .then((result) => {
        console.log("DiaryReadComponent.js deleteOnClick() then() => ", result);
        if (result.payload.result === "success") {
          alert(diaryParam.dateobject + "ÏùºÏûêÏùò Îã§Ïù¥Ïñ¥Î¶¨Í∞Ä ÏÇ≠Ï†úÎêòÏóàÏäµÎãàÎã§.");

          moveToDiaryList();
        }
        if (result.payload.error === "error") {
          alert(diaryParam.dateobject + "ÏùºÏûêÏùò Îã§Ïù¥Ïñ¥Î¶¨ ÏÇ≠Ï†úÎ•º Ïã§Ìå®ÌñàÏäµÎãàÎã§.");
          moveToDiaryRead(diaryParam.id);
        }
      })
      .catch((err) => {
        console.log("DiaryReadComponent.js deleteOnClick() catch() => ", err);
        alert(diaryParam.dateobject + "ÏùºÏûêÏùò Îã§Ïù¥Ïñ¥Î¶¨ ÏÇ≠Ï†úÎ•º Ïã§Ìå®ÌñàÏäµÎãàÎã§.");
        moveToDiaryRead(diaryParam.id);
      });
  };

  return (
    <div className="container">
      <br />
      <br />

      <h4>Îã§Ïù¥Ïñ¥Î¶¨Ï°∞Ìöå</h4>
      <hr />
      <br />
      <Form>
        <Form.Group className="mb-3">
          <Form.Label>Îã§Ïù¥Ïñ¥Î¶¨ÏùºÏûê</Form.Label>
          <Form.Control
            type="text"
            name="dateobject"
            value={diaryParam.dateobject}
            disabled
          />
          <Form.Text className="text-muted"></Form.Text>
        </Form.Group>
        <Form.Group className="mb-3">
          <Form.Label>ÏùºÍ∏∞ÎÇ¥Ïö©</Form.Label>
          <Form.Control
            as="textarea"
            rows={3}
            name="content"
            value={diaryParam.content}
            disabled
          />
        </Form.Group>
        <Form.Group controlId="formFile" className="mb-3">
          <Form.Label>ÏÇ¨ÏßÑ</Form.Label>
          <br />
          {diaryParam.picture ? (
            <Image
              //src={`http://localhost:8001/img/${diaryParam.picture}`}
              src={`https://picdiarybucket.s3.ap-northeast-2.amazonaws.com/${diaryParam.picture}`}
              rounded
            />
          ) : (
            <>ÏóÖÎ°úÎìúÌïòÏßÄ ÏïäÏùåüòÖ</>
          )}
          {/* <Form.Control type="file" name="picture" /> */}
        </Form.Group>
        <br />
        <br />
        <Link to={`../modify/${diaryParam.id}`}>
          <Button variant="outline-primary">Îã§Ïù¥Ïñ¥Î¶¨ ÏàòÏ†ïÏù¥Îèô</Button>
        </Link>
        &nbsp;&nbsp;
        <Button variant="outline-danger" type="button" onClick={deleteOnClick}>
          ÏÇ≠Ï†úÌïòÍ∏∞
        </Button>
        &nbsp;&nbsp;
        <Link to={`../`}>
          <Button variant="outline-secondary">Îã§Ïù¥Ïñ¥Î¶¨ Îã¨Î†•Ïù¥Îèô</Button>
        </Link>
        <br />
        <br />
      </Form>
    </div>
  );
};

export default DiaryReadComponent;
